    {
        for(i=0;i<n;i++)
        {
            scanf("%d",&a[p][i]);
        }
        for(i=0;i<n;i++)
        {
            for(j=0;j<n-i-1;j++)
            {
                if(a[p][j]>a[p][j+1])
                {
                    temp=a[p][j];
                    a[p][j]=a[p][j+1];
                    a[p][j+1]=temp;
                }
            }
            sum+=(i+1)*a[p][n-i-1];
        }
        printf("%.2lf\n",sum/n);
        sum=0;
    }
}

